import React, { useEffect, useState } from "react";
import classes from "./ResultPage.module.css";
import axios from "axios";
import Confetti from "react-confetti";
import { CircularProgressbar, buildStyles } from "react-circular-progressbar";
import "react-circular-progressbar/dist/styles.css";
import ChangingProgressProvider from "../../../UI/ProgressBar/ChangingProgressProvider";
import { useAsyncError, useSearchParams } from "react-router-dom";

function ResultPage(props) {
  const answerKey = JSON.parse(localStorage.getItem("correctAnswers"));
  const [answerPaper, setAnswerPaper] = useState([]);
  const [confetti, setConfetti] = useState(true);
  const [percentage, setPercentage] = useState(0);
  const [progress, setProgress] = useState(0);
  const [correctAnswers, setCorrectAnswers] = useState(0);
  const [dimensions, setDimensions] = useState({
    height: 650,
    width: 1262,
  });

  useEffect(() => {
    axios.get("http://localhost:3031/answers").then((res) => {
      console.log("RETURNED DATA :", JSON.stringify(res.data));
      setAnswerPaper(res.data);
    });
    setTimeout(() => {
      setConfetti(false);
    }, 5000);

    for (i = 0; i < length(answerKey); i++) {
      answerPaper.map((index) => {
        if (index.index === i) {
          if (index.answer === answerKey[i]) {
            setCorrectAnswers(correctAnswers + 1);
          }
        }
      });
    }
  }, []);

  const setProgressBar = () => {
    if (progress === 0) {
      setTimeout(() => {
        setPercentage(10);
      }, 1600);
    } else {
      setPercentage(0);
    }
  };

  return (
    <div className={classes.container}>
      {confetti && (
        <div className={classes.confettiContainer}>
          <Confetti
            numberOfPieces={200}
            width={dimensions.width}
            height={dimensions.height}
          />
        </div>
      )}
      <h1>Results</h1>
      <div className={classes.resultContainer}>
        <div className={classes.eachResult}>
          <div className={classes.info1}>Total Questions</div>
          <div className={classes.info2}>:</div>
          <div className={classes.info3}>20</div>
        </div>
        <div className={classes.eachResult}>
          <div className={classes.info1}>Category</div>
          <div className={classes.info2}>:</div>
          <div className={classes.info3}>General Knowledge</div>
        </div>
        <div className={classes.eachResult}>
          <div className={classes.info1}>Difficulty</div>
          <div className={classes.info2}>:</div>
          <div className={classes.info3}>Easy</div>
        </div>
        <div className={classes.eachResult}>
          <div className={classes.info1}>Correct Answers</div>
          <div className={classes.info2}>:</div>
          <div className={classes.info3}>10</div>
        </div>
        <div className={classes.gradeResult}>
          <div className={classes.infoGrade1}>Grade</div>
          <div className={classes.infoGrade2}>:</div>
          <div className={classes.infoGrade3}>A</div>
        </div>
        <div className={classes.progress}>
          <div>Graph</div>
          <div
            className={classes.progressbar}
            style={{ width: 300, height: 300 }}
            onFocus={setProgressBar()}
          >
            <CircularProgressbar
              value={percentage}
              text={`${percentage}%`}
              strokeWidth={20}
              counterClockwise
              styles={buildStyles({
                pathTransitionDuration: 0.5,
                textColor: "#4e8e3c",
                pathColor: "#4e8e3c",
                trailColor: "#6ac351c3",
                transform: "rotate(0.25turn)",
                transformOrigin: "center center",
              })}
            />
          </div>
        </div>
      </div>
      <div>
        <button>Show detailed Results</button>
      </div>
    </div>
  );
}

export default ResultPage;
